import React, { Component } from "react";
import Input from "../../common/Input";
import { Avatar } from "@mui/material";
import "../../css/inpu.css";

class Student_Signup extends Component {
  state = {
    account: {
      email: "",
      password: "",
      firstname: "",
      lastname: "",
      phoneno: "",
      religion: "",
      matric_marks: "",
      inter_marks: "",
      father_income: "",
      total_matric_marks: "",
      total_inter_marks: "",
      address: "",
    },
    step: 1,
  };

  handletype = (e) => {
    const account = { ...this.state.account };
    if (e.currentTarget.name === "gender") {
      account["gender"] = e.currentTarget.value;
    } else {
      account[e.currentTarget.name] = e.currentTarget.value;
    }

    this.setState({ account });
  };

  handlesubmit = (e) => {
    console.log(this.state);
    e.preventDefault();
  };

  fun1 = () => {
    this.setState({ ...this.state, step: 0 });
    const firstName = this.state.account.firstname;
    //console.log('First Name:', firstName);
  };

  render() {
    return (
      <React.Fragment>
        <div className="fluid-container pt-4 signup_container">
          <div className="shadow ps-1 m-5 bg-white signupform_radius">
            <div className="row">
              <div className="col-lg-5 col-md-6 col-sm-12 signupform_leftside">
                <Avatar
                  className="m-5"
                  sx={{ width: "80%", height: "auto" }}
                  src="images/signup.png"
                />

                <h2 className="mt-3 signupHeading">Let's Get You Set Up</h2>
                <p className="mt-2 signupPtag">
                  It should take only a couple of minutes to pair with your watch
                </p>
              </div>

              <div className="col-lg-7 col-md-6 col-sm-12 signupform_rightside">
                <form id="form" onSubmit={this.handlesubmit}>
                  {this.state.step === 1 ? (
                    <React.Fragment>
                      <Input
                        label="First Name"
                        value={this.state.account.firstname}
                        name="firstname"
                        type="text"
                        onchange={this.handletype}
                        placeholder="First Name"
                      />

                      <Input
                        label="Last Name"
                        value={this.state.account.lastname}
                        name="lastname"
                        type="text"
                        onchange={this.handletype}
                        placeholder="Last Name"
                      />

                      <Input
                        label="Phone Number"
                        value={this.state.account.phoneno}
                        name="phoneno"
                        type="tel"
                        onchange={this.handletype}
                        placeholder="Phone Number"
                      />

                      <Input
                        label="Email"
                        value={this.state.account.email}
                        name="email"
                        type="email"
                        onchange={this.handletype}
                        placeholder="Email"
                      />

                      <Input
                        label="Password"
                        value={this.state.account.password}
                        name="password"
                        type="password"
                        onchange={this.handletype}
                        placeholder="Password"
                      />

                      <Input
                        label="Address"
                        value={this.state.account.address}
                        name="address"
                        type="address"
                        onchange={this.handletype}
                        placeholder="Address"
                      />
                    </React.Fragment>
                  ) : (
                    <React.Fragment>
                      <Input
                        label="Matric Marks"
                        value={this.state.account.matric_marks}
                        name="matric_marks"
                        type="number"
                        onchange={this.handletype}
                        placeholder="Matric Marks"
                      />

                      <Input
                        label="Total Matric Marks"
                        value={this.state.account.total_matric_marks}
                        name="total_matric_marks"
                        type="number"
                        onchange={this.handletype}
                        placeholder="Total Matric Marks"
                      />

                      <Input
                        label="Inter Marks"
                        value={this.state.account.inter_marks}
                        name="inter_marks"
                        type="number"
                        onchange={this.handletype}
                        placeholder="Inter Marks"
                      />

                      <Input
                        label="Total Inter Marks"
                        value={this.state.account.total_inter_marks}
                        name="total_inter_marks"
                        type="number"
                        onchange={this.handletype}
                        placeholder="Total Inter Marks"
                      />

                      <Input
                        label="Father Income"
                        value={this.state.account.father_income}
                        name="father_income"
                        type="number"
                        onchange={this.handletype}
                        placeholder="Father Income"
                      />
                    </React.Fragment>
                  )}

                  <div className="signup_button">
                    <button
                      type="button"
                      className="btn btn-primary inputbtn mt-3"
                      onClick={this.fun1}
                    >
                      Back
                    </button>
                    <button
                      type="submit"
                      className="btn btn-primary inputbtn mt-3"
                      onClick={this.fun1}
                    >
                      {this.state.step === 1 ? "Next" : "Submit"}
                    </button>
                  </div>
                </form>
              </div>
            </div>
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default Student_Signup;
